/* harmony default export */ __webpack_exports__["default"] = ("<div class=\"inner-banner\">\n    <img src=\"assets/images/inner-banner-projectengineering.jpg\">\n    <div class=\"page-title\">\n        <div class=\"container\">\n            <div class=\"row\">\n                <div class=\"col-sm-12 center\">\n                    <h1>SOFTWARE ENGINEERING</h1>\n                    <h6>Softwares : Data Life-cycle Management : IT Staffing & Training</h6>\n                </div>\n            </div>\n        </div>\n    </div>\n</div>\n\n<section class=\"manage-service-tab inner-nav-tab\">\n    <div class=\"tab-navigation\">\n        <div class=\"col-sm-12\">\n            <div class=\"container\">\n                <ul ngbNav #nav=\"ngbNav\" [(activeId)]=\"active\" class=\"nav-tabs\">\n                    <li [ngbNavItem]=\"1\">\n                        <a ngbNavLink>Product Engineering</a>\n                        <ng-template ngbNavContent>\n                            <section class=\"section-project-engineering\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12\">\n                                            <p class=\"running-text\">\n                                                Competitive pressures, reduced time-to-market, increased demands of\n                                                customers, and globalization are\n                                                driving global product companies to explore the offshore route. A\n                                                reliable offshore partner can play\n                                                a key role from concept to the launch of the product. Product companies\n                                                have increased their\n                                                competitive advantage by partnering with offshore players for product\n                                                development.\n                                            </p>\n                                            <p>\n                                                We have been involved in architecting and building .NET driven business\n                                                solutions right from the\n                                                inception. Our .NET CoE has proven expertise in building world class\n                                                products using the latest\n                                                Microsoft® technologies and standards. Our knowledge of Microsoft® .NET\n                                                technologies and product\n                                                development methodologies enables us to work with customers across\n                                                domains and successfully address\n                                                their functional, usability, performance and scalability requirements.\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n                            <section class=\"methodologies\">\n                                <img src=\"assets/images/managservice/methodologies.jpg\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12 center\">\n                                            <h1>Our Methodology</h1>\n                                        </div>\n                                    </div>\n\n                                    <div class=\"row\">\n                                        <ul class=\"panel-container\">\n\n                                            <li *ngFor=\"let item of solution; index as i\">\n                                                <div class=\"icon-circle\">\n                                                    <i class=\"icon icon-medium\">\n                                                        <svg focusable=\"false\">\n                                                            <use attr.xlink:href=\"{{item.icon}}\"></use>\n                                                        </svg>\n                                                    </i>\n                                                </div>\n                                                <h6>{{item.title}}</h6>\n                                                <ul class=\"info-bar\">\n                                                    <li>\n                                                        {{item.info}}\n                                                    </li>\n                                                </ul>\n\n                                            </li>\n                                        </ul>\n\n                                    </div>\n                                </div>\n                            </section>\n\n                            <section class=\"engeering-grap\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-md-6 col-lg-6 col-sm-12\">\n                                            <h6>\n                                                We practice agile development methodologies to help you take advantage\n                                                of emerging market\n                                                opportunities. We develop software in time-boxed iterations; each\n                                                iteration is a discrete project\n                                                encompassing all the PDLC stages. Our agile software project is capable\n                                                of releasing standalone\n                                                working software at the end of each iteration.\n                                            </h6>\n                                        </div>\n\n                                        <div class=\"col-md-6 col-lg-6 col-sm-12\">\n                                            <img src=\"assets/images/managservice/engeering-grap.jpg\">\n                                        </div>\n                                        <div class=\"col-sm-12\">\n                                            <p>\n                                                Our solution architects also help you realize your vision of services\n                                                based products through\n                                                implementation of the Service Oriented Architecture (SOA) approach. They\n                                                provide consulting,\n                                                implementation, and re-engineering of existing product architectures\n                                                using the SOA framework<br><br>\n\n                                                The software products industry depends on bringing new concepts, new\n                                                versions and new features to\n                                                the market quickly. At the same time, development costs must be low,\n                                                predictable, and flexible. We\n                                                can help you address these daunting and seemingly conflicting\n                                                requirements for software products.\n\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n\n                            <section class=\"our-services-section\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12\">\n                                            <div class=\"container our-services\">\n                                            <div class=\"row\">\n                                                <div class=\"col-md-4 col-lg-4 col-sm-12 triangle\">\n                                                    <div class=\"v-center\">\n                                                        <div class=\"logo-circle\">\n                                                            <i class=\"icon icon-large\">\n                                                                <svg focusable=\"false\">\n                                                                    <use xlink:href=\"#icon_logoFlat\"></use>\n                                                                </svg>\n                                                            </i>\n                                                        </div>\n                                                        <h5>\n                                                            Arkedge Technologies<br>\n                                                            Services\n                                                        </h5>\n                                                    </div>\n                                                </div>\n\n                                                <div class=\"col-md-8 col-lg-8 col-sm-12 v-flex\">\n                                                    <ul>\n                                                        <li>\n                                                            Robust version design\n                                                        </li>\n                                                        <li>\n                                                            Cross-platform architecture\n                                                        </li>\n                                                        <li>\n                                                            Wide variety of integration requirements\n                                                        </li>\n                                                        <li>\n                                                            Comprehensive packaging\n                                                        </li>\n                                                        <li>\n                                                            Support over a range of environments\n                                                        </li>\n                                                    </ul>\n                                                </div>\n                                            </div>\n                                        </div>\n                                    </div>\n                                    </div>\n                                </div>\n                            </section>\n\n\n                            <section class=\"engeering-grap\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12\">\n                                            <p>\n                                                Our solution architects also help you realize your vision of services\n                                                based products through\n                                                implementation of the Service Oriented Architecture (SOA) approach. They\n                                                provide consulting,\n                                                implementation, and re-engineering of existing product architectures\n                                                using the SOA framework\n                                                <br> <br>\n                                                The software products industry depends on bringing new concepts, new\n                                                versions and new features to\n                                                the market quickly. At the same time, development costs must be low,\n                                                predictable, and flexible. We\n                                                can help you address these daunting and seemingly conflicting\n                                                requirements for software products.\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n                        </ng-template>\n                    </li>\n\n                    <li [ngbNavItem]=\"2\">\n                        <a ngbNavLink>Application Development</a>\n                        <ng-template ngbNavContent>\n                            <div class=\"container app-development\">\n                                <div class=\"row\">\n                                    <div class=\"col-sm-12\">\n                                        <p class=\"running-text\">\n                                            Arkedge has a well-defined and mature application development service\n                                            offering. Arkedge application development model covers all phases of the\n                                            Software Development Life Cycle (SDLC), beginning with transforming business\n                                            requirements into project functional requirements, development, quality,\n                                            testing, implementation, training and application support. Our distributed\n                                            delivery methodology effectively leverages the onsite subject matter\n                                            expertise and the offshore development teams, resulting in cost-effective\n                                            solutions. Each of the development phases can be defined with metrics and\n                                            subsequently tracked with the monitoring tools and well defined project\n                                            management and execution processes.\n                                        </p>\n                                        <p>\n                                            Arkedge provides outsourced software development services for in-house\n                                            applications, across the project lifecycle. We partner with you from\n                                            internal proposals and budgeting, through project approvals, all the way to\n                                            delivery, training, maintenance and support. Our flexible offshore software\n                                            development model allows companies to maximize their ROI, while maintaining\n                                            complete control over projects.\n                                        </p>\n\n                                        <p>\n                                            <img src=\"assets/images/managservice/app-dev-met.jpg\" align=\"right\">\n                                            At each stage of the application development cycle we bring people, process\n                                            and technology expertise to pro-actively guide you through the challenges of\n                                            meeting application requirements within budget, time and quality. A key\n                                            aspect of Arkedge's application development methodology is the early and\n                                            extensive use of screen mockups or wireframes. In our experience, mockups\n                                            and wireframes speed up initial approvals, improve the reliability of\n                                            requirements gathering and documentation, and greatly enhance user\n                                            acceptance and utilization of the delivered application.\n\n                                        </p>\n                                    </div>\n                                </div>\n                            </div>\n\n                            <section class=\"about-key-diff\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n\n                                        <div class=\"col-md-8 col-lg-8 col-sm-12\">\n                                            <h1>Key Differentiators</h1>\n                                            <ul>\n                                                <li *ngFor=\"let key of keydiff\">\n                                                    {{key.list}}\n                                                </li>\n                                            </ul>\n                                        </div>\n\n                                        <div class=\"col-md-4 col-lg-4 col-sm-12 v-flex\">\n                                            <img src=\"assets/images/managservice/key-difference.png\">\n                                        </div>\n\n                                    </div>\n                                </div>\n                            </section>\n\n                            <section>\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12\">\n                                            <p>\n                                                Systems modelling with analysis and design using UML tools Customers can\n                                                be rest assured that Arkedge will provide technical follow-through\n                                                during the planning, design, development and deployment of every\n                                                project. It also offers on-going management, maintenance and monitoring\n                                                of all developed applications and the systems they run on.\n                                            </p>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n                        </ng-template>\n                    </li>\n\n                    <li [ngbNavItem]=\"3\">\n                        <a ngbNavLink>UX/UI Development</a>\n                        <ng-template ngbNavContent>\n                            <div class=\"container\">\n                                <div class=\"row\">\n                                    <div class=\"col-sm-12\">\n                                        <p class=\"running-text\"> \n                                            ARKEDGE is a rapidly growing professionally managed organization with\n                                            competent and qualified brass at the helm of the affairs. The organization\n                                            is making its presence felt on the engineering solution and services,\n                                            Staffing and IT training circuit. Equipped with cross cultural operating\n                                            experience; an asset, it drives the organization to deliver nothing but the\n                                            best.\n                                        </p>\n                                        <p>\n                                            We specialize in improving operational performance and IT delivery.\n                                            We do this by improving the way our clients use people, processes and\n                                            technologies. Here is the place to envision, discover and fulfil your\n                                            technology needs.\n                                        </p>\n                                    </div>\n                                </div>\n                            </div>\n\n                            <section class=\"ui-ux-info\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div *ngFor=\"let item of uiUxInfo\" class=\"col-md-4 col-lg-4 col-sm-12\">\n                                            <div class=\"panel center\">\n                                                <div class=\"panel-heading\">\n                                                    <div class=\"icon-circle\">\n                                                        <i class=\"icon icon-large\">\n                                                            <svg focusable=\"false\">\n                                                                <use attr.xlink:href=\"{{item.icon}}\"></use>\n                                                            </svg>\n                                                        </i>\n                                                    </div>\n                                                    <h5>{{item.title}}</h5>\n                                                </div>\n                                                <div class=\"panel-body\">\n                                                    <p>{{item.description}}</p>\n                                                </div>\n                                            </div>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n                            <section class=\"ui-ux-process\">\n                                <div class=\"container\">\n                                    <div class=\"row\">\n                                        <div class=\"col-sm-12 center\">\n                                            <h1>UX/UI Development Process</h1>\n                                        </div>\n                                    </div>\n                                    <div class=\"row\">\n\n                                        <div class=\"col-md-3 col-lg-2 col-sm-12\">\n                                            <div class=\"icon-circle\">\n                                                <i class=\"icon icon-large\">\n                                                    <svg focusable=\"false\">\n                                                        <use xlink:href=\"#icon_strategy\"></use>\n                                                    </svg>\n                                                </i>\n                                            </div>\n                                        </div>\n                                        <div class=\"col-md-9 col-lg-10 col-sm-12\">\n                                            <h6>UX/UI Development Process</h6>\n                                            <p>Business requirements define the value proposition of a product. They are\n                                                the answers to why a new product is requested. As the visualized form of\n                                                requirements, user interface designs should be also based on business\n                                                requirements to satisfy the strategic level objectives of creating that\n                                                product.</p>\n                                        </div>\n\n                                    </div>\n                                    <div class=\"row\">\n                                        <div class=\"col-md-9 col-lg-10 col-sm-12\">\n                                            <h6>Understand your Users</h6>\n                                            <p>\"Designing for everybody\" is not a feasible and effective strategy in\n                                                terms of usability. Interfaces of a product are usable if they are good\n                                                fit for its users. Thus user interface design should be based on the\n                                                profile of target user groups.</p>\n                                        </div>\n\n                                        <div class=\"col-md-3 col-lg-2 col-sm-12\">\n                                            <div class=\"icon-circle\">\n                                                <i class=\"icon icon-large\">\n                                                    <svg focusable=\"false\">\n                                                        <use xlink:href=\"#icon_understanding\"></use>\n                                                    </svg>\n                                                </i>\n                                            </div>\n                                        </div>\n                                    </div>\n                                    <div class=\"row\">\n                                        <div class=\"col-md-3 col-lg-2 col-sm-12\">\n                                            <div class=\"icon-circle\">\n                                                <i class=\"icon icon-large\">\n                                                    <svg focusable=\"false\">\n                                                        <use xlink:href=\"#icon_product\"></use>\n                                                    </svg>\n                                                </i>\n                                            </div>\n                                        </div>\n                                        <div class=\"col-md-9 col-lg-10 col-sm-12\">\n                                            <h6>Define your Requirements & Content</h6>\n                                            <p>User interfaces are composed not only of functional requirements (tasks)\n                                                but also of content requirements. Therefore, in parallel to interaction\n                                                design (based on functional requirements), the information architecture\n                                                (based on content requirements) should be also designed. The main\n                                                objective of information architecture design is to identify content\n                                                requirements, define content categories, and finalize the navigation\n                                                structures.</p>\n                                        </div>\n\n                                    </div>\n                                    <div class=\"row\">\n                                        <div class=\"col-md-9 col-lg-10 col-sm-12\">\n                                            <h6>Shape your Product</h6>\n                                            <p>Our UX designers then convert interaction designs and information\n                                                architectures into user interfaces by applying UX design and usability\n                                                principles and guidelines. They design low-fidelity prototypes by\n                                                sketching or using prototyping tools. Then our Visual designers convert\n                                                low-fidelity prototypes into high-fidelity visual designs with the most\n                                                aesthetic color, metaphor, and font selections.</p>\n                                        </div>\n\n                                        <div class=\"col-md-3 col-lg-2 col-sm-12\">\n                                            <div class=\"icon-circle\">\n                                                <i class=\"icon icon-large\">\n                                                    <svg focusable=\"false\">\n                                                        <use xlink:href=\"#icon_value\"></use>\n                                                    </svg>\n                                                </i>\n                                            </div>\n                                        </div>\n                                    </div>\n                                </div>\n                            </section>\n\n                        </ng-template>\n                    </li>\n\n                    <li [ngbNavItem]=\"4\">\n                        <a ngbNavLink>Software Testing & QA</a>\n                        <ng-template ngbNavContent>\n                            <div class=\"container qa-testing\">\n                                <div class=\"row\">\n                                    <div class=\"col-sm-12\">\n                                        <p class=\"running-text\"> \n                                            Arkedge is committed to providing high-quality software solutions to its clients. Therefore we take a serious approach to the testing process and quality assurance of the solutions that are developed either by our development team or your existing or new applications. The current techniques and approaches applied to software testing help identify and prevent occurrence of the problems associated with the improper functionality, low reliability, productivity, scalability and other defects of the applications.\n                                        </p>\n                                        <p class=\"v-flex\">\n                                            We have robust testing processes and frameworks that can seamlessly plug and play at any stage of the software and product development life cycle to provide you the flexible scale and repeatability in meeting demanding quality requirements and go-live schedules.<br><br>\n                                            Our strong belief is to form a QA team in the initial stage of the development phase; this undoubtedly helps reduce the risks of fixing global bugs in later stages. The QA engineers are involved in the development process right off the mark: they are provided with the available documentation, acquainted with the business processes that are to be implemented in the project and technical specifications requested by the client. On the basis of the provided resources our engineers develop a testing plan that meets all the mentioned requirements. It defines the scope of testing and documents the process of quality assurance.\n                                            <img src=\"assets/images/managservice/qa-testing.png\" align=\"right\">\n                                        </p>\n                                        <p class=\"running-text manage-space\">Arkedge helps with critical aspects of clients' systems, such as planning, process control, performance metrics, test automation, test execution, defect tracking, and reporting.\n                                        </p>\n                                    </div>\n                                    <div *ngFor=\"let data of qaInfo\" class=\"col-lg-6 col-md-6 col-sm-12 qa-info\">\n                                        <div class=\"panel\">\n                                                <div class=\"panel-heading\">\n                                                   <h6>{{data.title}}</h6>\n                                                </div>\n                                                <div class=\"panel-body\">\n                                                    <p>{{data.info}}</p>\n                                                </div>\n                                         </div>\n                                    </div>\n\n                                </div>\n\n                                <div class=\"row qa-testing-info\">\n                                  <div class=\"col-md-4 col-lg-4 col-sm-12 v-flex\">\n                                        <div class=\"icon-circle\">\n                                            <i class=\"icon icon-large\">\n                                                <svg focusable=\"false\">\n                                                    <use xlink:href=\"#icon_seeting3\"></use>\n                                                </svg>\n                                            </i>\n                                        </div>\n                                    </div>\n                                    <div class=\"col-md-8 col-lg-8 col-sm-12\">\n                                        <h6>Functional Testing</h6>\n                                        <p>Functional testing is done using the functional specifications provided by the client or by using the design specifications like use cases provided by the design team. Functional testing validates that an application conforms to its specifications and meets its expected functional requirements. During functionality testing, a range of inputs as test data is created and tests are performed to validate if whether each feature conforms to the requirements.\n                                        </p>\n                                        \n                                        <div class=\"row\">\n                                            <div class=\"col-sm-12\">\n                                                <ul class=\"row qa-test-info\">\n                                                    <li *ngFor=\"let data of qafunctionTest\" class=\"col-md-6 col-lg-6 col-sm-12\">\n                                                        {{data.info}}\n                                                    </li>\n                                                </ul>\n                                            </div> \n                                        </div>\n\n                                    </div>\n\n                                </div>\n\n                                <div class=\"row qa-testing-info\">\n                                    \n                                      <div class=\"col-md-8 col-lg-8 col-sm-12\">\n                                          <h6>Non-Functional Testing</h6>\n                                          <p>Testing the application against client's performance requirement; Non-Functioning testing is done based on the requirements and test scenarios defined by the client.\n                                          </p>\n                                          \n                                          <div class=\"row\">\n                                              <div class=\"col-sm-12\">\n                                                  <ul class=\"row qa-test-info\">\n                                                      <li *ngFor=\"let data of qanonfunctionTest\" class=\"col-md-6 col-lg-6 col-sm-12\">\n                                                          {{data.info}}\n                                                      </li>\n                                                  </ul>\n                                              </div> \n                                          </div>\n  \n                                      </div>\n\n                                      <div class=\"col-md-4 col-lg-4 col-sm-12 v-flex\">\n                                        <div class=\"icon-circle\">\n                                            <i class=\"icon icon-large\">\n                                                <svg focusable=\"false\">\n                                                    <use xlink:href=\"#icon_seeting1\"></use>\n                                                </svg>\n                                            </i>\n                                        </div>\n                                    </div>\n  \n                                  </div>\n\n                                  <div class=\"row qa-testing-info\">\n\n                                        <div class=\"col-sm-12\">  \n                                            <h6>Automation Lab</h6>\n                                            <p>Arkedge has a special focus on software test automation using market standard tools. Arkedge approaches automation design and development as a software development project in itself; to create an automated testing solution that is flexible enough to adapt to changes in your application and that will not need much rewriting for each new build. Arkedge test automation experts will ensure your tool investment is put to good use and will build automation skills into your organization for future re-usability and maintainability.\n                                            </p>\n                                        </div>\n                                   \n\n                                    <div class=\"col-md-4 col-lg-4 col-sm-12 v-flex\">\n                                          <div class=\"icon-circle\">\n                                              <i class=\"icon icon-large\">\n                                                  <svg focusable=\"false\">\n                                                      <use xlink:href=\"#icon_seeting2\"></use>\n                                                  </svg>\n                                              </i>\n                                          </div>\n                                      </div>\n                                      <div class=\"col-md-8 col-lg-8 col-sm-12\">\n\n                                       \n <p>It is important to consider automation of the test environment as early as possible and design it into the system from the outset. It's also important to recognize that automation is not appropriate for every project or for all testing on any particular project.\n<br><br>\n    Arkedge can help you achieve this balance so that the benefit from test automation at the right time and in the right way. Some of the automation focus areas' are:\n                                          </p>\n                                          \n                                          <div class=\"row\">\n                                              <div class=\"col-sm-12\">\n                                                  <ul class=\"row qa-test-info\">\n                                                      <li *ngFor=\"let data of qalabfunctionTest\n                                                      \" class=\"col-md-6 col-lg-6 col-sm-12\">\n                                                          {{data.info}}\n                                                      </li> \n                                                  </ul>\n                                              </div> \n                                          </div>\n  \n                                      </div>\n  \n                                  </div>\n\n                            </div>\n                        </ng-template>\n                    </li>\n                </ul>\n            </div>\n        </div>\n    </div>\n\n\n    <div [ngbNavOutlet]=\"nav\"></div>\n\n\n</section>");

